import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with increased timeout
    await page.goto(fileUrl, { timeout: 60000 });
    await page.waitForLoadState('domcontentloaded');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for and extract navigation links
    await page.waitForSelector('a', { timeout: 5000 });
    const navLinks = await page.$$eval('a', links => 
      links.map(link => ({
        text: link.textContent.trim(),
        href: link.href
      }))
    );

    // Extract product data from script content
    const productData = await page.evaluate(() => {
      const scriptContent = Array.from(document.scripts)
        .find(script => script.textContent.includes('const products ='));
      return scriptContent ? scriptContent.textContent : null;
    });

    // Extract user data elements
    await page.waitForSelector('.profile-info, .orders-list, .wishlist-items', { timeout: 5000, state: 'attached' });

    const profileData = await page.$$eval('.profile-info, .profile-stats', elements => 
      elements.map(el => el.textContent.trim())
    );

    // Extract category data
    const categoryData = await page.$$eval('.category-card, .nav-links a', elements => 
      elements.map(el => el.textContent.trim())
    );

    // Take screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Extracted navigation structure, product data, user profile information, and category data",
      extractedData: {
        navigationLinks: navLinks.slice(0, 20), // First 20 links
        productDataSnippet: productData ? productData.substring(0, 200) + '...' : 'No product data found',
        profileInfo: profileData,
        categories: categoryData.slice(0, 10) // First 10 categories
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete bulk data extraction",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
